"use strict";

module.exports = {
  'getCurrentScript': function getCurrentScript(browser) {
    browser.url("".concat(browser.launch_url, "/fixtures/test.html")).assert.containsText('#app', "".concat(browser.launch_url, "/fixtures/log-src.js")).end();
  },
  'getCurrentScript in microtask': function getCurrentScriptInMicrotask(browser) {
    browser.url("".concat(browser.launch_url, "/fixtures/test-microtask.html")).assert.containsText('#app', "".concat(browser.launch_url, "/fixtures/log-src-in-microtask.js")).end();
  },
  'use it as a polyfill': function useItAsAPolyfill(browser) {
    browser.url("".concat(browser.launch_url, "/fixtures/test-polyfill.html")).assert.containsText('#app', 'It works!').end();
  }
};